INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(2, 'Rolex Daytona', 49000.00, 'El Rolex Daytona, presentado en 1963, es un reloj icónico en el mundo de la relojería. Diseñado inicialmente para satisfacer las necesidades de los pilotos de carreras, ha trascendido su función original para convertirse en un símbolo de estatus y elegancia.\r\n\r\nLos modelos más recientes, como el Daytona 116503, pueden costar alrededor de 30,500 €, mientras que variaciones bicolor con esfera blanca pueden tener precios más accesibles. Es recomendable verificar precios y disponibilidad en el mercado actual.', 'https://www.rolex.com/es/watches/cosmograph-daytona', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(3, 'Rolex Deepsea', 56000.00, 'El Rolex Deepsea es un reloj de buceo profesional diseñado para soportar grandes profundidades. Puede alcanzar hasta 3900 metros (12,800 pies) de hermeticidad y está equipado con una válvula de helio, lo que lo convierte en uno de los modelos más robustos de Rolex para exploración submarina.\r\n', 'https://www.rolex.com/es/watches/deepsea', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(4, 'Rolex GMT-Master II', 11100.00, 'El Rolex GMT-Master II es un icónico reloj de la marca Rolex, caracterizado por su capacidad de mostrar múltiples zonas horarias gracias a su aguja adicional que da la vuelta a la esfera en 24 horas. Este modelo introdujo un bisel Cerachrom de cerámica, lo que le proporciona durabilidad y un diseño elegante.', 'https://www.rolex.com/es/watches/gmt-master-ii', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(5, 'Audemars Piguet Royal Oak', 160000.00, 'El Audemars Piguet Royal Oak es un reloj icónico que representa la visión del lujo sin concesiones de la marca. Su diseño vanguardista y habilidad técnica lo han convertido en un símbolo de la alta relojería. La línea incluye modelos como el Royal Oak Flying Tourbillon Automático, que mide 41 mm y se ofrece en materiales como acero inoxidable, titanio, oro y platino.', 'https://www.audemarspiguet.com/com/es/watch-collection/royal-oak/26605CB.OO.1248CB.01.html?_gl=1*a3het8*_up*MQ..&gclid=CjwKCAiA3Na5BhAZEiwAzrfagLu4ePG9L3yFOji1M0dppeJ3uzXZDVtL0zXp9PYe2-5LyLS4ohy8_BoCuyIQAvD_BwE&gclsrc=aw.ds', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(6, 'Audemars Piguet Royal Oak Offshore', 200000.00, 'La colección Royal Oak Offshore de Audemars Piguet se lanzó en 1993 y se caracteriza por sus diseños audaces, deportivos y robustos. Estos relojes son conocidos por sus materiales de alta calidad, como cerámica y correas de caucho, y su estética distintiva. Los precios de los modelos pueden variar, por ejemplo, un modelo con esfera y correa de caucho azules cuesta alrededor de 36,100 €, mientras que uno con bisel de cerámica puede costar aproximadamente 37,400 €.', 'https://www.audemarspiguet.com/com/es/watch-collection/royal-oak-offshore/26622CE.OO.D002CA.01.html?_gl=1*1tbrx17*_up*MQ..&gclid=CjwKCAiA3Na5BhAZEiwAzrfagLu4ePG9L3yFOji1M0dppeJ3uzXZDVtL0zXp9PYe2-5LyLS4ohy8_BoCuyIQAvD_BwE&gclsrc=aw.ds', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(7, 'Audemars Piguet Calendario Perpetuo', 110000.00, 'El Audemars Piguet Calendario Perpetuo es un reloj de alta complicación que presenta un mecanismo capaz de rastrear ciclos de 48 meses sin necesidad de ajustes manuales hasta el año 2100. Este tipo de reloj, específicamente el Royal Oak Perpetual Calendar, es muy valorado por su precisión y artesanía, destacando modelos como el Royal Oak Calendario Perpetuo de John Mayer. Esta línea combina la elegancia del oro rosa y complicaciones avanzadas como el Calibre 5134.', 'https://www.audemarspiguet.com/com/es/watch-collection/code-1159/26394BC.OO.D027KB.01.html?_gl=1*1w6fhvs*_up*MQ..&gclid=CjwKCAiA3Na5BhAZEiwAzrfagLu4ePG9L3yFOji1M0dppeJ3uzXZDVtL0zXp9PYe2-5LyLS4ohy8_BoCuyIQAvD_BwE&gclsrc=aw.ds', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(8, 'Patek Philippe Nautilus', 720000.00, 'El Patek Philippe Nautilus es una colección de relojes de lujo de estilo deportivo, reconocida por su diseño elegante con una cara octagonal redondeada. Fue lanzado en 1976 y ha ganado popularidad tanto entre hombres como mujeres. Los modelos, como el Nautilus Perpetual Calendar, pueden alcanzar precios elevados, como el de catálogo de 135,910 €.', 'https://www.patek.com/es/coleccion/nautilus/5811-1G-001', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(9, 'Jacob & Co Bugatti Tourbillon', 300000.00, 'El Jacob & Co Bugatti Tourbillon es un reloj de lujo que combina la ingeniería de alta relojería con el diseño automovilístico del Bugatti Chiron. Este reloj es conocido por su movimiento de alta complicación y su integración única entre la relojería y el mundo del automóvil. Solo se han producido 126 piezas limitadas, lo que lo convierte en un objeto de colección extremadamente exclusivo.', 'https://jacobandco.com/timepieces/bugatti-tourbillon', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(10, 'Jacob & Co Casino Tourbillon', 380000.00, 'El Jacob & Co Casino Tourbillon es un reloj de lujo que presenta una mesa de ruleta funcional en miniatura. Está elaborado en oro rosa y ónice, y cuenta con un movimiento de tourbillon volador. Este modelo tiene 268 componentes y ofrece una reserva de marcha de 72 horas.', 'https://jacobandco.com/timepieces/casino-tourbillon', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(11, 'Jacob & Co Opera Godfather', 500000.00, 'El Jacob & Co Opera Godfather es un reloj musical que rinde homenaje a la película \"El Padrino\". Tiene una caja de 49 mm que presenta elementos visuales y gráficos inspirados directamente en la película. En su versión del 50 aniversario, la caja está finamente grabada con 13 escenas icónicas de la película.', 'https://jacobandco.com/timepieces/opera-godfather', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(12, 'Jacob & Co Caviar Tourbillon', 700000.00, 'El Jacob & Co. Caviar Tourbillon es un reloj de lujo reconocido por su diseño elegante y exclusivo, caracterizado por una superficie plana y suave, saturada de gemas negras. Este reloj simboliza el lujo y se encuentra disponible en distintas versiones, como el Tsavorites, que tiene un precio de 780.000 euros.\r\n\r\n', 'https://jacobandco.com/timepieces/caviar-tourbillon', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(13, 'Jacob & Co The World Is Yours Dual Time Zone', 57000.00, 'El Jacob & Co The World Is Yours Dual Time Zone es un reloj de lujo que presenta un diseño con doble zona horaria. Está impulsado por el movimiento automático exclusivo JCAA11, que permite ajustar cada sub-dial de manera independiente. Además, cuenta con una reserva de marcha de 42 horas.', 'https://jacobandco.com/timepieces/dual-time-zone', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(16, 'Jacob & Co Astronomia Solar Zodiac', 230000.00, 'El Jacob & Co. Astronomia Solar Zodiac es un reloj de lujo que presenta un diseño similar a un observatorio astronómico. Su caja tiene un diámetro de 43.40 mm y es una versión redondeada del original Astronomia. Este modelo combina la relojería de alta precisión con un diseño visualmente impactante, destacando elementos del zodiaco solar.', 'https://jacobandco.com/timepieces/astronomia-solar-zodiac', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(18, 'Patek Philippe Cubitus', 85000.00, 'El Patek Philippe Cubitus es un reloj de lujo que se caracteriza por su diseño deportivo elegante y su caja cuadrada. Está disponible en una variedad de materiales como acero, oro rosa y platino, lo que le otorga un estilo \"casual chic\". Su esfera puede tener acabados únicos, como un disco ornamentado que representa el cielo, con estrellas y lunas doradas, que gira dentro de una ventanilla.', 'https://www.patek.com/es/empresa/actualidad/cubitus-gran-fecha-ref-5822p-001', 13, '2024-11-27 15:16:43', , NULL);
INSERT INTO `watches` (`id`, `name`, `price`, `information`, `official_url`, `created_by`, `created_at`, `image_upload`, `image`) VALUES
(20, 'Patek Philippe Hora Universal', 280000.00, 'El Patek Philippe Hora Universal, lanzado en la década de 1930, es un reloj que permite leer la hora en los 24 husos horarios de un vistazo. Su diseño incluye un disco de 24 horas dividido en zonas de día y noche, con un fondo plateado y un sol dorado. Este modelo está impulsado por un movimiento mecánico de carga automática, Calibre 240 HU C, y también ofrece indicación de fecha por aguja.', 'https://www.patek.com/es/empresa/actualidad/hora-universal-con-fecha-ref-5330g-001', 13, '2024-11-27 15:16:43', , NULL);

